INSERT INTO `projeto` (`codigo`, `titulo`, `descricao`, `prioridade`, `data_inicio`, `data_prazo`, `data_fim`, `criado_por`, `codigo_status`) VALUES
(1, 'Projeto Básico - Sistema de Monitoramento', 'Este projeto traduz novos requisitos de serviços mapeados pela Secretaria de Comunicação e busca implantar uma dina?mica de gesta?o de dados, informac?o?es, noti?cias e conteu?dos de imprensa e mi?dias sociais sobre o Governo do Estado do Pará que auxiliara?o a tomada de deciso?es estrate?gicas, at', 1, '2016-02-18', '2016-02-29', NULL, 0, 1),
(2, 'Demandas', 'Neste projeto devem ser colocadas as demandas rápidas do mês.', 2, '2016-02-01', '2016-12-31', NULL, 0, 1),
(4, 'Teste Encerramento Singular', 'Teste para quando usuário tem apenas uma tarefa.', 2, '2016-02-18', '2016-02-19', NULL, 0, 1),
(5, 'Feira do Livro', 'Este projeto deve englobar as atividades relacionadas a Feira do Livro 2016', 3, '2016-02-18', '2016-04-30', NULL, 6, 1),
(6, 'Dia Mundial da Água', 'Criar campanha do dia Mundial da Água', 2, '2016-02-18', '2016-03-10', NULL, 0, 1),
(7, 'Aplicativo Agência ', 'Desenvolvimento de aplicativo para o Agência Pará. ', 3, '2016-02-19', '2016-02-29', NULL, 0, 1),
(8, 'Retrospectiva 2015', '<p>Desenvolver o site para apresentar as 40 hist&oacute;rias mais emocionantes relacionadas com o Governo do Estado do Par&aacute; no ano de 2015.</p>', 3, '2016-01-01', '2016-03-18', NULL, 0, 1),
(9, 'Topo do Portal PA', 'Topos do Portal PA devem ser atualizados.', 1, '2016-02-23', '2016-02-23', NULL, 0, 1),
(13, 'Campanha Mensagem do Governo na Alepa ', 'Desenvolver campanha para as redes sociais do Governo com base na "Mensagem do Governo à Alepa 2016". ', 2, '2016-02-23', '2016-03-31', NULL, 0, 1),
(15, 'Nova Identidade Redes do Governo', 'Desenvolvimento da nova identidade visual das redes sociais do Governo do Pará. ', 3, '2016-02-15', '2016-02-29', NULL, 0, 1),
(16, 'Vídeo tutorial #meubempara ', 'Desenvolver vídeo tutorial ensinando ao usuário como participar. ', 2, '2016-02-23', '2016-03-01', NULL, 0, 1),
(17, 'Vídeos Detran ', 'Desenvolvimento de uma série de vídeos com situações cotidianas do trânsito identificando erros e acertos. ', 2, '2016-02-15', '2016-03-04', NULL, 0, 1),
(18, 'Campanha Aedes Aegypti ', 'Desenvolvimento de campanha digital contra o mosquito Aedes Aegypti ', 3, '2016-02-12', '2016-03-25', NULL, 0, 1),
(19, 'Campanha Especial Mensal - Ambulatório LGBT', '<p>Desenvolver campanha para redes sociais do Governo.</p>', 2, '2016-02-19', '2016-02-27', NULL, 0, 0),
(20, 'Campanha Mês da Mulher ', '<p>Desenvolver campanha para as redes sociais em comemora&ccedil;&atilde;o ao Dia da Mulher.</p>', 3, '2016-02-22', '2016-03-07', NULL, 0, 1),
(21, 'Campanha do Oscar Hemopa', 'Na verdade é apenas uma peça que o Hemopa irá disparar no domingo no momento do Oscar', 1, '2016-02-24', '2016-02-26', NULL, 6, 1),
(22, 'Vídeo Igeprev ', 'Desenvolver um vídeo tutorial com passo a passo do acesso à Cédula C.', 2, '2016-02-25', '2016-03-03', NULL, 15, 1),
(23, 'Banners site NAC ', '<p>A Assessoria do NAC solicitou 3 banner para serem colocados no site deles. 2 S&atilde;o do PA mas precisam ser modificados 1 Para ser criado</p>', 2, '2016-02-24', '2016-02-26', NULL, 0, 1),
(24, 'Campanha da Água', '---', 2, '2016-02-22', '2016-03-30', NULL, 15, 1),
(25, 'Publicom', 'Encontro de Comunicação Pública do Pará que será realizado nos dias 4, 5 e 6 de Maio, na Estação das Docas. ', 3, '2016-02-29', '2016-05-13', NULL, 14, 1),
(26, 'Relatório EGPA', '<p>Produzir relat&oacute;rio de visita &agrave; EGPA.</p>', 3, '2016-02-29', '2016-03-01', NULL, 0, 0),
(27, 'Teste Luiza', '<p>Teste Luiza</p>', 2, '2016-03-01', '2016-03-30', NULL, 0, 0),
(28, 'Imãs de brinde  ', '<p>A Secretaria vai entregar uma carta para as reda&ccedil;&otilde;es apresentando o novo Ag&ecirc;ncia, PA e redes do Governo, junto &agrave; carta ir&atilde;o dois im&atilde;s com fotografias do Par&aacute;.</p>', 2, '2016-03-03', '2016-03-07', NULL, 0, 1),
(29, 'Identidade Visual - Materiais Internos ', '<p>Definir identidade visual para documentos e outros materiais internos da Secretaria.&nbsp;</p>', 3, '2016-03-07', '2016-03-30', NULL, 0, 1),
(30, 'Materiais Pro Paz ', '<p>Desenvolver m&aacute;scaras e banners de apresenta&ccedil;&atilde;o do Pro Paz e seus projetos.</p>', 3, '2016-03-07', '2016-03-18', NULL, 15, 1),
(31, 'Capa SEMA', '<p>Produzir capa e avatar para fanpage da SEMA</p>', 2, '2016-03-10', '2016-03-11', NULL, 15, 1),
(32, 'Relatório de Fevereiro ', '<p>Produzir relat&oacute;rio de atividades da DCI do m&ecirc;s de fevereiro.</p>', 2, '2016-03-14', '2016-03-18', NULL, 15, 1),
(33, 'Pauta - TV Agência', '<p>Esse projeto ser&aacute; para incluir todas as demandas vinculadas &agrave; TV Ag&ecirc;ncia. Pautas, entrevistas ou mat&eacute;rias especiais.&nbsp;</p>', 2, '2016-03-14', '2016-03-31', NULL, 0, 1),
(34, 'DCI Visita', '<p>Incurs&atilde;o realizada pela DCI para fazer um diagn&oacute;stico da comunica&ccedil;&atilde;o digital do Governo do Par&aacute; a partir dos &oacute;rg&atilde;os e das diversas assessorias presentes na web. A visita inclui reuni&otilde;es semanais com os assessores das secretarias do governo q', 2, '2016-01-01', '2016-12-31', NULL, 0, 1),
(35, 'Apresentação Nardin', '<p>Apresenta&ccedil;&atilde;o do Secretario para divulga&ccedil;&atilde;o do novo workflow da SECOM.</p>', 3, '2016-03-11', '2016-03-17', NULL, 4, 1),
(36, 'Homologação dos sites Prodepa', '<p>Avalia&ccedil;&atilde;o e cr&iacute;tica dos sites desenvolvidos pela Prodepa com novo padr&atilde;o do Governo do Estado.</p>', 3, '2016-03-15', '2016-03-17', NULL, 4, 1);
