(18, 'Atualização site SECOM', 'Criar área Administrativa, sub-área Licitações e disponibilizar o projeto básico para download em PDF.', 3, '2016-02-18', '2016-02-25', '2016-02-24', 1, 6, 0, 1, 5, 1),
(19, 'Atualização site SECOM', 'Publicar matéria sobre gastos com publicidade:\n- http://www.secom.pa.gov.br/site/noticias/governo-diminui-gastos-com-publicidade-institucional/', 1, '2016-02-22', '2016-02-24', '2016-02-24', 1, 6, 0, 2, 5, 1),
(20, 'Atualização site SECOM', 'Publicar matéria:\r\n- http://www.secom.pa.gov.br/site/noticias/jornalistas-debatem-deveres-direitos-e-etica-profissional-em-parauapebas/', 2, '2016-02-22', '2016-02-24', '2016-02-24', 1, 6, 6, 2, 5, 1),
(21, 'Seleção do material', 'Nagano deve selecionar 4 ou 5 vídeos e enviar a URL dos mesmos para o João Lemos, que se encarregará do próximo passo.', 1, '2016-02-24', '2016-02-25', '2016-02-25', NULL, NULL, 0, 9, 13, 1),
